import datetime

class Solution:
    def palindromePairs(self, words):
        returnValue = []
        num = len(words)
        for index1 in range(0,num):
            for index2 in range(index1+1,num):
                if(index1 != index2):
                    if((len(words[index1]) == 0) or (len(words[index2])) == 0):
                        returnValue.append([index1,index2])
                        returnValue.append([index2,index1])
                    else:
                        if(words[index1][0] == words[index2][-1] and self.isPalindrome(words[index1] + words[index2])):
                            returnValue.append([index1,index2])
                        if(words[index2][0] == words[index1][-1] and self.isPalindrome(words[index2] + words[index1])):
                            returnValue.append([index2,index1])
        return returnValue

    def isPalindrome(self, string):
        if(len(string) <= 1):
            return True
        return string == string[::-1]

        # splitpoint = len(string) // 2 
